    <div className="header">
        <Link to='/' className="logo-container">
            <Logo className="logo"/>
        </Link>        
        <div className="options">
            <Link className="option" to="/shop">
                SHOP
            </Link>
            <Link className="option" to="/shop">
                CONTACT
            </Link>

            <Link className="option" to="/signin">
                SIGN IN
            </Link>

        </div>
    </div>  
)
